    <span style="font-size: 18px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-size: 14px; letter-spacing: 1px; text-indent: 28px; color: rgb(0, 0, 0); box-sizing: border-box !important; overflow-wrap: break-word !important;">Sharklet中文名为“鲨纹”，这是一种仿生学物理抗菌方式，模拟鲨鱼皮肤排布，通过改变材料表面纹路/纹理以达到抗菌目的。</span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); font-size: 14px; letter-spacing: 1px; text-indent: 28px; box-sizing: border-box !important; overflow-wrap: break-word !important;">最早由美国佛罗里达大学材料工程学教授布伦南发明，于2004年提交发明专利的方式面世。</span></span>
</p>
