    <span style="font-size: 18px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-size: 14px; letter-spacing: 1px; text-indent: 28px; color: rgb(246, 200, 2); box-sizing: border-box !important; overflow-wrap: break-word !important;">生活中的抗菌场景分为两种，一是物体表面脏污，一是难以清洗的物体。</span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); font-size: 14px; letter-spacing: 1px; text-indent: 28px; box-sizing: border-box !important; overflow-wrap: break-word !important;">比如冰箱的保鲜盒内的细菌数超安全线750倍；浴缸中含致病菌的比例为26%，垃圾桶中含致病菌的比例是6%，而手机上的细菌含量超马桶10倍，表面脏污无处不在。</span></span>
