    <span style="font-size: 18px;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); font-size: 14px; letter-spacing: 1px; text-indent: 28px; box-sizing: border-box !important; overflow-wrap: break-word !important;">据罗永浩现场介绍，</span><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-size: 14px; letter-spacing: 1px; text-indent: 28px; color: rgb(246, 200, 2); box-sizing: border-box !important; overflow-wrap: break-word !important;">Sharklet技术率先应用在医疗器械上</span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); font-size: 14px; letter-spacing: 1px; text-indent: 28px; box-sizing: border-box !important; overflow-wrap: break-word !important;">，在美国，每年都会出现100000例的院内感染。过量使用抗生素导致超级细菌的不断形成，使得人类对抗感染疾病的战争愈发严峻，需要一种全新的应对方法。</span></span>
</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
    <span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); letter-spacing: 1px; text-indent: 28px; font-size: 18px; box-sizing: border-box !important; overflow-wrap: break-word !important;"><br/></span>
</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
    <span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); letter-spacing: 1px; text-indent: 28px; font-size: 18px; box-sizing: border-box !important; overflow-wrap: break-word !important;">Sharklet技术能让细菌无法附着于材料表面，极大地预防了感染，通过这样简单的纯物理作用即可达到抑制感染的功效。</span>
</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
    <span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); letter-spacing: 1px; text-indent: 28px; font-size: 18px; box-sizing: border-box !important; overflow-wrap: break-word !important;"><br/></span>
</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
    <span style="font-size: 18px;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); font-size: 14px; letter-spacing: 1px; text-indent: 28px; box-sizing: border-box !important; overflow-wrap: break-word !important;">除在医疗领域的应用外，Sharklet技术不会导致健康安全问题或带来耐药菌的添加物及化学成分。所以呢，你的手机贴膜或者手机壳都有可能使用的Sharklet技术。</span><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-size: 14px; letter-spacing: 1px; text-indent: 28px; color: rgb(246, 200, 2); box-sizing: border-box !important; overflow-wrap: break-word !important;">另外还可以应用到硅胶制品、人造皮革制品、高密塑料制品等。</span></strong></span>
</p>
