</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
    <br/>
</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
    <span style="font-size: 18px;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); font-size: 14px; letter-spacing: 1px; text-indent: 28px; box-sizing: border-box !important; overflow-wrap: break-word !important;">不过据扬子晚报报道，</span><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; font-size: 14px; letter-spacing: 1px; text-indent: 28px; color: rgb(0, 0, 0); box-sizing: border-box !important; overflow-wrap: break-word !important;">早在2015年，苏州百益倍肯新材料科技有限公司研发了鲨鱼博士抗菌塑料薄膜，并已申请专利。</span></strong><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); font-size: 14px; letter-spacing: 1px; text-indent: 28px; box-sizing: border-box !important; overflow-wrap: break-word !important;">发明者也是这家公司的创始人——留美博士李浪，他当时对这项技术的介绍，与今天发布会的介绍非常相似。</span></span>
</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
    <span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); letter-spacing: 1px; text-indent: 28px; font-size: 18px; box-sizing: border-box !important; overflow-wrap: break-word !important;"><br/></span>
</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
    <span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(84, 84, 84); letter-spacing: 1px; text-indent: 28px; font-size: 18px; box-sizing: border-box !important; overflow-wrap: break-word !important;">发明者李浪博士是这么描述的：生物学家发现鲨鱼皮肤看上去非常光滑，但在微观下，鲨鱼皮肤表面是有粗糙的V形皱褶的，这种结构可以大大减少水流的摩擦力，实验表明，细菌在这种结构中难以附着和繁殖。</span>
</p>
<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: -apple-system-font, BlinkMacSystemFont, &quot;Helvetica Neue&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei UI&quot;, &quot;Microsoft YaHei&quot;, Arial, sans-serif; font-size: 17px; letter-spacing: 0.544px; text-align: center; white-space: normal; background-color: rgb(255, 255, 255); box-sizing: border-box !important; overflow-wrap: break-word !important;">
